import './TeamInfo.css';
const TeamInfo = (props) => {
    const player = props.playerList
    const totalPlayerFee = player.reduce((totalPlayerFee, player) => totalPlayerFee + player.salary, 0);
    // let selectedPlayerList = "\n"
    const selectedPlayerList = player.map(pl => pl.name+"\n")
    return (
        <div>
            <div className="team-main-info">
                
                <h3>Selected players name ðŸ‘‡</h3>
                <div className="new-line">
                    <h6>{selectedPlayerList} </h6>               
                </div>
            </div>
        </div>
    );
};

export default TeamInfo;
